import React from 'react';
import {Container, Row, Table, Card} from 'react-bootstrap';

class Files extends React.Component{

      componentDidMount() {
        fetch("http://10.15.10.250:8080/extract_dev2/files")
        .then(res => res.json())
        .then(
            (result) => {
                console.log(result)
                // this.setState({
                //     // users: result
                //     // isLoaded: true,
                //     // selectedOption: "Please choose"
                // });
            },
            (error) => {
                this.setState({
                    error
                });
                console.log(this.state.error)
            }
        )

    }
  render() {
    return(
      <>
        <Container className="mt-5 mb-5">
            <Card className="p-2">
              <Card.Body>
                <Row className="justify-content-md-center">
                  <Card.Title>Extracted Workflow Scripts</Card.Title>
                </Row>
                <Row className="justify-content-md-center">
                  <Table striped bordered hover variant="dark">
                    <thead>
                      <tr>
                        <th>Filename</th>
                        <th>Date Created</th>
                        <th>Options</th>
                      </tr>
                    </thead>
                    <tbody>
                      <tr>
                        <td>file.sql</td>
                        <td>Today</td>
                        <td>^ -</td>
                      </tr>
                      <tr>
                        <td>file_final_final_final.sql</td>
                        <td>Today</td>
                        <td>^ -</td>
                      </tr>
                    </tbody>
                  </Table>
                </Row>
              </Card.Body>
            </Card>
        </Container>
      </>
    );
  }
}
  
  export default Files;
